ALTER SESSION SET NLS_DATE_FORMAT='DD/MM/YYYY';
SET LINESIZE 120
SET PAGESIZE 100

CREATE TABLE Examination(
   exam_date    DATE       NOT NULL,
   exam_time    VARCHAR(5) NOT NULL,
   pet_id       VARCHAR(7) NOT NULL,
   temperature  NUMBER(3)  NOT NULL CHECK(temperature <= 50 AND temperature >= 5),
   employee_id  VARCHAR(8) NOT NULL,
   disease_id   VARCHAR(5) NOT NULL,
   release_date DATE       NOT NULL,
   task_id VARCHAR(6) NOT NULL,
   primary key(exam_date, exam_time, pet_id),
   CONSTRAINT fk_examinatiOn_pet FOREIGN KEY(pet_id) REFERENCES Pet(pet_id),
   CONSTRAINT fk_examination_employee FOREIGN KEY(employee_id) REFERENCES Employee(employee_id),
   CONSTRAINT fk_examination_taskID FOREIGN KEY(task_id) REFERENCES Task(task_id),
   CONSTRAINT examination_chk_release CHECK (release_date >= exam_date)
);


select count(*) as TotalExaminationRecords from Examination;
